/*Table structure for table `subscription_detail` */

DROP TABLE IF EXISTS `subscription_detail`;

CREATE TABLE `subscription_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `transactionid` varchar(50) DEFAULT NULL,
  `title` varchar(100) DEFAULT NULL,
  `msisdn` bigint(14) DEFAULT NULL,
  `makemodel` varchar(100) DEFAULT NULL,
  `amount` varchar(20) DEFAULT NULL,
  `transtime` datetime DEFAULT '0000-00-00 00:00:00',
  `response` varchar(30) DEFAULT NULL,
  `packageid` int(11) DEFAULT NULL,
  `retry` int(11) DEFAULT '0',
  `poid` varchar(5) DEFAULT NULL,
  `prid` bigint(20) DEFAULT NULL,
  `contentpath` varchar(200) DEFAULT NULL,
  `downloadtype` varchar(50) DEFAULT NULL,
  `circle` varchar(10) DEFAULT NULL,
  `responsedesc` varchar(2000) DEFAULT NULL,
  `circlename` varchar(30) DEFAULT NULL,
  `telcoid` varchar(5) DEFAULT NULL,
  `ri_time` datetime DEFAULT '0000-00-00 00:00:00',
  `ru_time` datetime DEFAULT '0000-00-00 00:00:00',
  `contentPrice` varchar(20) DEFAULT NULL,
  `stype` varchar(10) DEFAULT NULL,
  `ptype` varchar(50) DEFAULT NULL,
  `telconame` varchar(100) DEFAULT NULL,
  `smsstatus` varchar(5) DEFAULT NULL,
  `mode` varchar(50) DEFAULT NULL,
  `responsecode` int(5) DEFAULT NULL,
  `country` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `subscription_detail_indx_transactionid_msisdn_package` (`transactionid`,`msisdn`,`packageid`),
  KEY `idx_transtime` (`msisdn`,`packageid`),
  KEY `idx_response` (`response`)
